import React from "react";

function About() {
  return (
    <div>
      <h1>About Page</h1>

      <img
        src="https://dawsontc003.github.io/responsive-portfolio/Assets/Dawson,%20Thomas%20Resume.pdf"
        class="card-img-to"
        alt="image of secure password generator project"
        width="400"
        height="300"
      ></img>
    </div>
  );
}

export default About;
